/* ===========================
   VARIABLES LIGHT / DARK
=========================== */
:root {
    --bg: #f3f4f6;
    --card: #ffffff;
    --text: #111827;
    --subtext: #6b7280;
    --accent: #2563eb;
    --button: #e5e7eb;
}

@media (prefers-color-scheme: dark) {
    :root {
        --bg: #0f172a;
        --card: #111827;
        --text: #f9fafb;
        --subtext: #9ca3af;
        --accent: #3b82f6;
        --button: #1f2937;
    }
}

body {
    margin: 0;
    height: 100vh;
    background: var(--bg);
    font-family: system-ui, -apple-system, BlinkMacSystemFont, sans-serif;
    display: flex;
    justify-content: center;
    align-items: center;
    color: var(--text);
}

.card {
    width: 100%;
    max-width: 360px;
    background: var(--card);
    border-radius: 22px;
    padding: 30px;
    text-align: center;
    box-shadow: 0 20px 40px rgba(0,0,0,0.25);
}

.avatar {
    width: 110px;
    height: 110px;
    border-radius: 50%;
    object-fit: cover;
    border: 4px solid var(--accent);
    margin-bottom: 12px;
}

h1 {
    margin: 8px 0 4px;
    font-size: 22px;
}

p {
    margin: 0 0 18px;
    font-size: 14px;
    color: var(--subtext);
}

/* ===========================
   BOTONES
=========================== */
.link {
    display: flex;
    align-items: center;
    gap: 12px;
    padding: 14px;
    margin: 10px 0;
    background: var(--button);
    border-radius: 14px;
    text-decoration: none;
    color: var(--text);
    font-size: 16px;
    transition: 0.2s;
}

.link:hover {
    background: var(--accent);
    color: white;
    transform: scale(1.02);
}

.link i {
    width: 22px;
    font-size: 20px;
}

.save-contact {
    background: var(--accent);
    color: white;
    font-weight: bold;
}

.save-contact:hover {
    opacity: 0.9;
}

/* ===========================
   FOOTER
=========================== */
footer {
    margin-top: 18px;
    font-size: 12px;
    color: var(--subtext);
}
</style>

<!-- EVENTO GOOGLE MAPS -->
<script>
function trackMaps() {
    gtag('event', 'click_ubicacion', {
        event_category: 'contacto',
        event_label: 'google_maps'
    });
}
</script>
